      # sample['time_since_shot_action'] = np.random.uniform(size=num_steps)
      # sample['time_since_pass_action'] = np.random.uniform(size=num_steps)
  
      
      p_location = np.array([sample['left_team'][i, p,: ] for i, p in enumerate(
        sample['active'])])
      p_direction = np.array([sample['left_team_direction'][
        i, p, :] for i ,p in enumerate(sample['active'])])
      sticky_actions = sample['sticky_actions']
      # import pdb; pdb.set_trace()
      # p_tired = np.array([sample['left_team_tired_factor'][
      #   i, p] for i,p in enumerate(sample['active'])]).reshape(-1, 1)
      # p_role = np.array([sample['left_team_roles'][
      #   i,p] for i, p in enumerate(sample['active'])]).reshape(-1,1)
  
      right_rel_location = sample['right_team']-np.expand_dims(p_location, 1)
      right_rel_direction = sample['right_team_direction']-np.expand_dims(
        p_direction, 1)
      
      left_rel_location = sample['left_team']-np.expand_dims(p_location, 1)
      left_rel_direction = sample['left_team_direction']-np.expand_dims(
        p_direction, 1)
      left_tired = np.expand_dims(sample['left_team_tired_factor'], -1) # 1
      left_roles = ohe(sample['left_team_roles'], 10) # 10
      left_actives = np.expand_dims(sample['left_team_active'], -1)
      
      right_team_tired_factor = np.expand_dims(
        sample['right_team_tired_factor'], -1)
      right_team_roles = ohe(sample['right_team_roles'], 10)
      
